           </p>
           <div className = 'center '>
               <div className = 'center form pa4 br3 shadow-5'>
                  <input className = 'f4 pa2 pv1 w-70 center' type = 'text'/>
                  <button className = 'w-30 grow br2 f4 link ph3 pv1 dib white bg-light-blue' >Detect</button>
               </div>
           </div>
        </div>
    )
}

export default ImageLinkForm;
